import React,{Tex} from "react";
import App from "./App";


const Home = () => {
    return (
        <div>
            <header className="bg-gray fixed w-100 ph3 pv3 pv4-ns ph4-m ph5-l">
                <nav className="f6 fw6 ttu tracked">
                    <Text></Text>
                    <a className="link dim black dib mr3" href="http://localhost:3000" title="Home">Home</a>
                    <a className="link dim black dib mr3" onClick={() => <App/>} title="About">About</a>
                    <a className="link dim black dib mr3" href="http://localhost:3000" title="Store">Store</a>
                    <a className="link dim black dib" href="http://localhost:3000" title="Contact">Contact</a>
                </nav>
            </header>
        </div>
    );
}

export default Home;
